import React from 'react';
import Agencytable from '../Agency/Agencytable.js'
import './Agencyta'

const Agencyinfo = (props) => {
    const data=props.data;
  return (
    <div>
        <div className='proptext'>List of available properties along with owner contact</div>
        
            <table>
                <thead>
                    <tr>
                        <th scope="col">Agency Name</th>
                        <th scope="col">Rating</th>
                        <th scope="col">Contact No.</th>
                        <th scope="col">Location</th>
                    </tr>
                </thead>
                {data.map((row, index)=>{
                    return <Agencytable one={row.Agency_name} two={row.Rating} three={row.Contact_no} four={row.Location}></Agencytable>
                })}
               
            </table>
        </div>
  )
}

export default Agencyinfo
